('BT001', N'Hà Nội: Xử lý nghiêm xe quá tải trọng', N'Tăng cường kiểm tra, xử phạt các phương tiện vi phạm', N'Nguyễn Văn A', N'Sở GTVT Hà Nội chỉ đạo các lực lượng chức năng tăng cường kiểm tra, xử lý nghiêm các trường hợp xe chở quá tải trọng quy định, gây mất an toàn giao thông và hư hỏng kết cấu hạ tầng.', 'data:image/png;base64,', N'Bản tin'),
('BT002', N'TP.HCM: Triển khai thu phí không dừng tại các trạm BOT', N'Đẩy nhanh tiến độ, đảm bảo đồng bộ hệ thống thu phí', N'Trần Thị B', N'UBND TP.HCM yêu cầu các đơn vị liên quan đẩy nhanh tiến độ triển khai thu phí không dừng (ETC) tại tất cả các trạm thu phí BOT trên địa bàn, đảm bảo hệ thống hoạt động thông suốt, hiệu quả.', 'data:image/png;base64,', N'Bản tin'),
