('BT004', N'Cần Thơ: Khởi công xây dựng cầu vượt nút giao thông trọng điểm', N'Giải quyết ùn tắc, nâng cao năng lực lưu thông', N'Phạm Văn D', N'UBND TP. Cần Thơ tổ chức lễ khởi công xây dựng cầu vượt tại nút giao thông Nguyễn Văn Linh - 3 Tháng 2, nhằm giải quyết tình trạng ùn tắc giao thông tại khu vực này.', 'data:image/png;base64,', N'Bản tin'),
