('BT007', N'Đồng Nai: Mở rộng hệ thống camera giám sát giao thông', N'Nâng cao hiệu quả quản lý, giám sát giao thông', N'Trần Văn G', N'Sở GTVT Đồng Nai triển khai lắp đặt thêm hệ thống camera giám sát giao thông tại các tuyến đường trọng điểm, phục vụ công tác quản lý, điều hành và xử lý vi phạm giao thông.', 'data:image/png;base64,', N'Bản tin'),
('BT008', N'Long An: Tuyên truyền, phổ biến luật giao thông đường bộ', N'Nâng cao ý thức chấp hành luật giao thông cho người dân', N'Lê Thị H', N'Ban An toàn giao thông tỉnh Long An tổ chức các hoạt động tuyên truyền, phổ biến Luật Giao thông đường bộ cho người dân, đặc biệt là đối tượng học sinh, sinh viên.', 'data:image/png;base64,', N'Bản tin'),
('BT009', N'Tiền Giang: Xây dựng bãi đỗ xe thông minh', N'Ứng dụng công nghệ, giải quyết nhu cầu đỗ xe', N'Phạm Văn I', N'UBND TP. Mỹ Tho (Tiền Giang) đầu tư xây dựng bãi đỗ xe thông minh, ứng dụng công nghệ hiện đại, giúp người dân dễ dàng tìm kiếm chỗ đỗ xe và thanh toán phí.', 'data:image/png;base64,', N'Bản tin'),
('BT010', N'Vĩnh Long: Ra quân kiểm tra an toàn kỹ thuật phương tiện', N'Đảm bảo phương tiện tham gia giao thông an toàn', N'Hoàng Văn K', N'Sở GTVT Vĩnh Long tổ chức đợt cao điểm kiểm tra an toàn kỹ thuật và bảo vệ môi trường đối với các phương tiện giao thông cơ giới đường bộ.', 'data:image/png;base64,', N'Bản tin');